?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: Times New Roman;">Эта одна из немногих компаний, которая может похвастаться своей богатой историей за, относительно небольшой период, своего существования. Началось все с того, что основатель компании, которого звали Мартин Браун, поступил в специализированную часовую школу. Но на этом обучении он не остановился, решил дальше приумножать свой накопленный опыт. В итоге он поступил в университет, и уже в 1991 году получил «Мастера часового искусства». В качестве защиты диплома, он выбрал настольные часы, механизм которых был настолько усложнен, что даже некоторые преподаватели не понимали, как он функционирует. Достаточно перечислить лишь некоторые функции, которые присутствовали в часах, чтобы понять всю сложность механизма: определение фаз Луны, 8-дневный запас хода, республиканский календарь, уравнение времени. Мартин Браун решил не останавливаться на достигнутом, и вскоре, занялся&nbsp;разработкой уникальных и инновационных моделей часов. В 1998 году Мартин решает поделиться своим накопленным опытом с общественность, для чего и организовал специальные семинары, которые были посвящены часовым усложнениям. После этого, его знали практически в каждой стране. Но он также продолжал работать над своим изобретением – моделью EOS. После того, модель была доработана, в 2000 году он презентовал ее на выставке. Его разработка заняла второе место среди всех инновационных технологий. С тех пор, Мартин Браун производит несколько моделей часов, которые завоевали популярность во всем мире, благодаря своей многофункциональности, надежности и точности. </span></span></p>
 
